                    <p>
                        As an immigrant who came to America as a refugee from her war-torn nation of Liberia, Cynthia Logan understands the plight of a young child who finds
                        themselves dodging bullets and walking alongside dead bodies. She knows what it is like to abruptly leave everything while seeking refuge in neighboring
                        countries.
                    </p>
                    <p>
                        When Cynthia’s family arrived in the United States in the early nineties, their “normal” life had changed. She saw her parents st");
            WriteLiteral(@"ruggle. They could no
                        longer afford to provide basic necessities for their children. Cynthia remembers being denied all forms of public assistance for the first few years in
                        America. Until her family gained immigration status, they found themselves relying on churches, pantries, thrift stores, and organizations to meet their
                        basic needs. Regardless of the reason for a person’s immigrant or refugee status, Cynthia believes the transition weighs heavily on young children than
                        many people realize.
                    </p>
                    <p>
                        Cynthia’s family are generations educators, naturally her career path landed her to continue family tradition. After years of hardship and becoming 
                        acclimated to her new environment, she completed requirement for a high school diploma. Understanding that she must acquire advanced education, twelve
                      ");
            WriteLiteral(@"  years after highs school, she pursued her dream of becoming an education and impacting the lives of young people.
                    </p>
                    <p>
                        Cynthia has the ability to connect with people seamlessly, especially youth. This ability has opened doors for countless positive interactions with 
                        her students. As a mentor, she helped shaped the lives of the many students she taught. She believes that she has located her life’s purpose, which 
                        is to advocate and be a voice for people who cannot speak for themselves.
                    </p>
                    <p>
                        Cynthia is a wife, a mother, author, speaker, and an accomplished educator who has taught both General and Special Education students in the United 
                        States and abroad. Her students (including Special Education population) achieved satisfactory scores on state and district assessments. After years 
         ");
            WriteLiteral(@"               of teaching and serving students from marginalized communities, she witnessed many negative aspects of poverty. She believes that no child’s education 
