                <div class=""card-body"">
                    <h4 class=""card-title"">Ezekiel Glay</h4>
                    <h6 class=""card-title"">MBA – Board Chair </h6>
                    <p>Born and raised in Liberia, Ezekiel Glay emigrated to the US as a refugee in 1994. That experience ");
            WriteLiteral(@"inspired his commitment to improving the lives of others. Passionate about public service, Mr. Glay has over 15 years of experience working in various roles in the public sector. He began his professional career with the US Navy as a hospital corpsman in 1995.</p>
                    <p>Before moving to Georgia, the Department of Housing and Urban Development appointed him a Presidential Management Fellow in the Office of the Chief Financial Officer in Washington, DC. He currently serves as a Management Analyst with the federal government in Atlanta. </p>
                    <p>Mr. Glay has a broad range of skills that include program and risk management, process improvement, budgeting, procurement management, and regulation analysis. He has worked with legislative aides, business leaders, and community organizations to develop balanced and impactful public policies, build consensus on a wide range of issues, and implement a number of community initiatives.</p>
                    <p>Mr. Glay received his ");
            WriteLiteral(@"undergraduate degree in Political Science from California State University, San Marcos. He has a Master of Public Administration (MPA) from Columbia University and l’Institut d'Etudes Politiques de Paris (Sciences-Po). Additionally, he earned his Master of Business Administration (MBA) from The Scheller College of Business at the Georgia Institute of Technology.</p>
                </div>
            </div>
