                <div class=""card-body"">
                    <h4 class=""card-title"">Arnold Joseph</h4>
      ");
            WriteLiteral(@"              <h6 class=""card-title"">MBA-Operations Committee Chair</h6>
                    <p>Arnold Joseph is an accomplished Supply Chain and Manufacturing Operations Director with over 25 years of success directing manufacturing and supply chain strategies that support successful business operations. He is also skilled at developing marketing initiatives that drive sales and revenue for new and established products. Arnold exudes finesse when negotiating supplier contracts that deliver cost-effective pricing for goods and services. His excellent leadership and managerial skills affords him the ability to mentor and empower employees to achieve a high level of performance and success. Arnold holds an MBA in Finance Iona College, New Rochelle, NY and a Bachelor of Science Dual degree in Transportation, Distribution and Operations Management, Syracuse University, Syracuse NY.</p>
                    <p>Arnold Joseph has had many achievements throughout his career. While serving as Senior Manager for CSM B");
            WriteLiteral(@"akery Solutions, he successfully directed cross-functional teams through transformational changes that greatly improved manufacturing efficiency and productivity. As Senior Director of Material Sourcing and Procurement for GNC/Nutra Manufacturing, he implemented an e-procurement sourcing study on packaging materials that resulted in a multi-year agreement that delivered an annual savings of 18%. </p>
                    <p>As the Executive Director of Strategic Sourcing for the Detroit Public Schools, Arnold spearheaded initiatives that delivered $4M in bottom line savings, and improved communications with internal stakeholders, suppliers and customers. </p>
                    <p>Currently, Arnold has taken his business success from Corporate America to President & Executive Consultant with SUPPLY CHAIN LINK LLC. a Supply Chain Consultancy that is committed and focused to best practices to promote business growth and productivity. This is achieved by providing innovative thought leadership and strategic th");
            WriteLiteral(@"inking that results in positive Lean transformative continuous improvements and sourcing methodologies that create operational excellence for all enterprises from start- ups to Fortune 500.</p>
                </div>
            </div>
            <div class=""modal-footer"">
                <button type=""button"" class=""btn btn-secondary"" data-dismiss=""modal"">Close</button>
            </div>
